@model function fitmb(data, prob)
    global c=1+c
    println(c)

    #σ1 =78697619.8358 #~ InverseGamma(2, 3)
    #σ2 =112634208.8#~ InverseGamma(2, 3)
    #σ3 =0.9786#~ InverseGamma(2, 3)
